import React from 'react';
import { BrowserRouter as Router, Route, Navigate, Routes } from 'react-router-dom'; // Updated imports
import { AuthProvider, useAuth } from './context/AuthContext'; // Updated path
import Login from './components/Login'; // Updated path
import Dashboard from './components/Dashboard'; // Updated path

// Protected Route Component
const ProtectedRoute = ({ component: Component }) => {
    const { isAuthenticated } = useAuth();

    return isAuthenticated() ? <Component /> : <Navigate to="/login" />;
};

const App = () => {
    return (
        <AuthProvider>
            <Router>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/dashboard" element={<ProtectedRoute component={Dashboard} />} />
                    <Route path="/" element={<Navigate to="/login" />} />
                    {/* Add more routes here */}
                </Routes>
            </Router>
        </AuthProvider>
    );
};

export default App;
